import React from "react";
import { mapIcon,mailIcon,callIcon } from "../assets/icons/index";

function IconWithInfo(props) {
  return (
    <div className="flex justify-start items-center text-sm p-8
    ">
      <img className="h-10 " src={props.icon} alt="{props.icon}" />
      <p className="p-">{props.info}</p>
    </div>
  );
}

const ContactUs = () => {
  return (
    <div>
      <div className="flex w-full min-h-screen bg-primaryThree justify-center items-center">
        <div className="flex flex-col justify-between ">
          <div>
            <h1 className="font-[itim] text-4xl tracking-tight py-3 px-4">Contact us</h1>
            <div>
              <IconWithInfo
                icon={mapIcon}
                info={
                  "16 Liffey Ave, Liffey Valley Park, Lucan,Co. Dublin, K78 HW50, Ireland"
                }
              />
              <IconWithInfo
                icon={mailIcon}
                info={
                  "hello@earthly.ie"
                }
              />
              <IconWithInfo
                icon={callIcon}
                info={"+353 1552 4908"
                }
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactUs;
